import React from "react";
import {NavLink} from "./react-router-dom";

const Menu = () => {
    return (
        <>
        <NavLink to = "/RouterService">Our service</NavLink>
        <NavLink to = "/RouterAbout">About us</NavLink>
        </>
    )
}

export default Menu;
